import React from 'react';
import './Column.scss';
import Card from '../Card/Card';

const Column = props => (
    <div className='column'>
        <div className='column-title'>{props.title}</div>
        { props.cards.map(card => 
            <Card 
                title={card.title} 
                text={card.text}
                />
                ) 
        }
    </div>
)

export default Column;
